INSERT INTO `productuploads` (`id`, `email`, `productname`, `currency`, `perViewRate`, `productprice`, `descrproduct`, `qtynumber`, `productcategory`, `views`, `viewsneeded`, `amountincurred`, `photographs`, `phonenumber`, `fullname`, `uploaddate`) VALUES
(19, 'nuelodekunle20@gmail.com', 'MeWe Television ', 'USD', 0.1000, 135000.0000, 'The MeWe TVs are available in different sizes like 32, 43, 50, and 65 inches, and some models feature smart capabilities and double glass design. \\n\\nImage Quality & Features:\\nLED Technology:\\nMewe TVs utilize LED technology, known for its energy efficiency and bright, clear picture quality. \\nAdjustable Contrast and Brightness:\\nUsers can customize the picture settings to their preference for optimal viewing. \\n\\nPicture Engine:\\nSome models, like the MW-FTB431S, utilize a Crystal Processor 4K for enhanced picture processing. \\nScreen Technology:\\nDouble glass technology is featured in some models, potentially offering enhanced durability and visual clarity. \\n\\nResolution:\\nMewe TVs come in various resolutions, including HD and 4K, offering different levels of detail. \\n\\nFrameless Design:\\nSome models feature a frameless design, maximizing the screen area and offering a more immersive viewing experience. \\n\\nConnectivity:\\nMultiple HDMI and USB ports: Allow for connecting various devices like gaming consoles, DVD players, and external storage.\\n\\nWi-Fi and Bluetooth: Enable wireless streaming and connectivity with other devices.\\n\\nEthernet (RJ45): Provides a wired internet connection for stable streaming.\\nOther Input: VGA and PC audio input are also available on some models. \\n\\nSmart Features:\\nSmart TV Operating Systems: Some Mewe TVs run on operating systems like WebOS, WhaleOS, or Wisdomshare OS. \\nDigital Media Player: Allows users to play media files directly from USB drives. \\n\\nOther Notable Features:\\nWarranty: Some Mewe TVs come with a manufacturer\\\'s warranty.\\nWall Bracket: Includes a wall bracket for convenient mounting.\\n\\nAudio Quality: Mewe TVs are designed to provide a sound experience comparable to being in a stadium or other live venue. \\n', 100, 'technology', 0, '1', 0.1000, '../uploads/img_6863d3f11f938.jpeg', '09151294786', 'Emmanuel Odekunle', '2025-07-01 12:26:25'),
(18, 'nuelodekunle20@gmail.com', 'Engine Burger', 'USD', 0.1000, 100.0000, 'fnefefjnejfnjfn', 2, 'education', 0, '1', 0.1000, '../uploads/img_6841ab258cfda.png', '09151294786', 'Emmanuel Odekunle', '2025-06-05 14:35:17'),
(17, 'nuelodekunle20@gmail.com', 'Fashionista Wristwatch', 'NGN', 5.0000, 1000.0000, '2000', 1, 'beauty', 0, '1', 5.0000, '../uploads/img_6841498678483.png', '09151294786', 'Emmanuel Odekunle', '2025-06-05 07:38:46');
