(1, 'nuelodekunle20@gmail.com', 'How To Create an Explorer Account on The Virtual Adviser Platform', 'NGN', 5.0000, 'https://www.youtube.com/embed/scrzoGAfZVs?si=ZF8YdXiL76zSI9T6', 'The Virtual Adviser is a peer-to-peer community connecting anyone, anywhere, and at any time with genuine problem solvers. Our commitment to quality, personalized, and refined advice is unwavering!\r\n\r\nVisit our website at https://thevirtualadviser.com.ng or download the Virtual Adviser app on Apple and Google Play stores. Follow us on social media, and subscribe to our newsletter for awesome updates!', 'Technology', 6, 0.0000, 25.0000, 20, '20', 100.0000, '2024-02-06 23:00:17'),
(2, 'nuelodekunle20@gmail.com', 'How to upload videos on Grow Social and go viral', 'NGN', 5.0000, 'https://www.youtube.com/embed/EmIbfWCSIuo?si=3Pxr__IYPAeh0uwN', ' First, sign up on the Grow Social website to create your account. Once logged in, explore the various plans offered and choose the one that best fits your needs and budget. Complete your account setup by providing essential details about your business and social media accounts. Next, pinpoint the specific services you\'re interested in‚Äîwhether it\'s boosting video views, increasing follower count, enhancing conversions, generating leads, handling social tasks, or gaining valuable contacts. Tailor the settings to align with your preferences, specifying demographics, interests, or locations for targeted campaigns. If your chosen plan involves a cost, proceed with the payment to activate your account. Once set up, leverage the analytics tools provided by Grow Social to monitor and assess the performance of your campaigns. And, in case you encounter any challenges or have inquiries, don\'t hesitate to reach out to their customer support, known for its impressive assistance. Always remember to review the terms and conditions for a clear understanding of the platform\'s policies and potential risks. Happy growing!', 'Education', 14, 0.0000, 25.0000, 70, '100', 500.0000, '2024-02-07 11:56:11'),
(3, 'wisdommedia247@gmail.com', 'Are We Living in the End Times - by Pastor Yisau Odekunle', 'NGN', 5.0000, 'https://www.youtube.com/embed/ZIFsfxx_SlI?si=RiUjMjRE9y1m29kc', 'The word of God is yea and amen. Get blessed with this escathological teaching from Pastor Olatoye Odekunle. You can reach him for prayers and conselling on spiritual matters via whatsapp/call on +2348143488580 or reach out via wisdommedia247@gmail.com. Be blessed!', 'Religion', 5, 0.0000, 25.0000, 75, '200', 1000.0000, '2024-02-07 13:01:39'),
(4, 'nuelodekunle20@gmail.com', 'Nigeria vs South Africa LIVE | CAF African Cup Of Nations 2024 | Match LIVE Today!', 'NGN', 5.0000, 'https://www.youtube.com/embed/Fsc-HiXghTw?si=T3GB8z7Xhwcg2nTk', 'Nigeria vs South Africa LIVE | African Cup of Nations 2023 | Match Live Today - Highlights & Goals - 07/02/2024.', 'Sports', 10, 0.0000, 25.0000, 10, '10', 50.0000, '2024-02-07 19:40:03'),
(5, 'wisdommedia247@gmail.com', 'Are We Living in the End Times (Part 2) - by Pastor Yisau Odekunle', 'NGN', 5.0000, 'https://www.youtube.com/embed/ebUwH0sEI1Q?si=Er9GeE76-gOx294u', 'The word of God is yea and amen. Get blessed with this escathological teaching from Pastor Olatoye Odekunle. You can reach him for prayers and conselling on spiritual matters via whatsapp/call on +2348143488580 or reach out via wisdommedia247@gmail.com. Be blessed!', 'Religion', 5, 0.0000, 25.0000, 83, '100', 500.0000, '2024-02-08 12:37:05'),
(6, 'nuelodekunle20@gmail.com', 'I Spent 100+ Hours with 4 Billionaires (here√¢‚Ç¨‚Ñ¢s what I learned)', 'NGN', 5.0000, 'https://www.youtube.com/embed/01OzXMCqjLk?si=aPbs3VeVCzZkXUh9', 'After spending 100 hours with these 4 billionaires√¢‚Ç¨¬¶\r\n\r\nI discovered what REALLY sets billionaires apart from the average entrepreneur.\r\n\r\nEach encounter was a unique lesson in business and life.\r\n\r\nAnd while it√¢‚Ç¨‚Ñ¢s easy to see their success√¢‚Ç¨¬¶\r\n\r\nYou don&#39;t always see the struggles and strategies behind it.\r\n\r\nBut the biggest lesson I learned is that while their paths are diverse√¢‚Ç¨¬¶\r\n\r\nTheir mindsets share striking similarities.\r\n\r\nSo how do you tap into the billionaire mindset so that more wealth and success flow your way?\r\n\r\nThat√¢‚Ç¨‚Ñ¢s what I reveal in today√¢‚Ç¨‚Ñ¢s episode, where I share the life-changing lessons I√¢‚Ç¨‚Ñ¢ve learned from my billionaire mentors.\r\n\r\nChapters\r\n0:00 I Spent 100+ Hours with 4 Billionaires\r\n0:05 Billionaire #1\r\n1:20 Billionaire #2\r\n3:28 Billionaire #3\r\n5:49 Billionaire #4\r\n', 'Entreprenuership', 7, 0.0000, 25.0000, 10, '10', 50.0000, '2024-02-08 13:01:26'),
(7, 'nuelodekunle20@gmail.com', 'Food Chefs Problem - Mark Angel Comedy (Emanuella)', 'NGN', 5.0000, 'https://www.youtube.com/embed/3o7FcGmoJo8?si=KQG4Wlw0Y-8sN45N', 'Food Chefs Problem - Mark Angel Comedy (Emanuella)\r\n\r\nHey guys, welcome to Emanuella Youtube channel. Here you will be having very funny  entertainment videos of me (Emanuella). Thanks for being a wonderful fans and part for my success story. ', 'Comedy', 27, 0.0000, 25.0000, 10, '10', 50.0000, '2024-02-08 13:07:03'),
(8, 'nuelodekunle20@gmail.com', 'He Kills 24 Girls To Make The Perfect Perfume Which Gives Him God Like Powers', 'NGN', 5.0000, 'https://www.youtube.com/embed/zHVbRx1M9fE?si=gH4RMOCCKTojiDT1', 'A man born with a superior olfactory sense becomes a murderer when he begins looking for the purest scents to create the world&#39;s most powerful perfume\r\n\r\n', 'Entertainment', 13, 0.0000, 25.0000, 5, '5', 25.0000, '2024-02-08 21:45:09'),
(9, 'nuelodekunle20@gmail.com', 'Meet The Kid Who Made $1M dollars with ChatGPT', 'NGN', 5.0000, 'https://www.youtube.com/embed/irEi7DVBHdA?si=vWvCPDkxFRKRMD4n', 'In this video, I head out to Toronto to meet Joe Popelas - one of the only kids who ACTUALLY made $1M with ChatGPT. He shared everything about how he found the idea, how he started it, how he advertises it, and how anyone can take advantage of the goldmine that is AI automation and ChatGPT generated ebooks. This is one of the craziest business ideas I&#39;ve seen in a minute, hope you guys enjoy this one!', 'Breaking News', 1, 0.0000, 25.0000, 5, '5', 25.0000, '2024-02-08 21:49:10'),
(10, 'nuelodekunle20@gmail.com', 'Kizz Daniel, Davido - Twe Twe (Official Video)', 'NGN', 5.0000, 'https://www.youtube.com/embed/041PlAGNMsQ?si=TYd2AA1jdNpGnHIS', 'Official Video by Kizz Daniel & Davido - &#34;Twe Twe&#34; √Ç¬© 2024 FlyBoy INC / EMPIRE\r\n', 'Music', 2, 0.0000, 25.0000, 10, '10', 50.0000, '2024-02-08 22:13:54'),
(11, 'nuelodekunle20@gmail.com', 'Gamer Rage | Supa Strikas | Full Episode Compilation | Soccer Cartoon', 'NGN', 10.0000, 'https://www.youtube.com/embed/AVi9t0yzrds?si=hCxFJUqGdgpYdan5', 'The beautiful cat burglar, Kat, is notoriously good at infiltrating high-tech buildings! Under orders from Strikas√¢‚Ç¨‚Ñ¢ arch-enemies, she plants a spy bug in the Secret Training Compound! How will the team be able to counter the cunning Invincible United in their upcoming game?', 'Movies', 180, 0.0000, 5.0000, 5, '5', 50.0000, '2024-02-08 22:30:26'),
