(15, 'nuelodekunle20@gmail.com', 'Tinubu Tells Nigerians To Be Patriotic + Army Says Nigeria is at War | Arise News', 'NGN', 5.0000, 'https://www.youtube.com/embed/Kpf-2gV3utw?si=5oRh1njt6ZfGhs4g', 'As Nigerians continue to bask in the euphoria of the Super Eagle√¢‚Ç¨‚Ñ¢s victory over the Bafana Bafana of South Africa, President Bola Ahmed Tinubu on Thursday, directed the mandatory recitation of the National Pledge after the National Anthem at every official and public engagement, to ensure respect for the national symbols, strengthen allegiance and fidelity to √¢‚Ç¨Àúcountry√¢‚Ç¨‚Ñ¢ and to preserve Nigeria&#39;s ethos and defining character. The president gave the directive during the groundbreaking ceremony of a housing project in Abuja.\r\n\r\nThe Defence Headquarters, on Thursday declared that Nigeria is at war while calling on citizens to close ranks with the military to win the war. \r\n\r\nThe Director of Defence Media Operation, Major General Edward Buba, made the declaration, while addressing newsmen at the Defence Headquarters, he added that Unity is key to our victory in overcoming the security challenges confronting us as a nation.\r\n\r\nOver 120,000 Nigerian refugees camping in Cameroon, have called on President Bola Ahmed Tinubu to expedite action that would see them return home. \r\n\r\nThe group in a letter dated January 8th 2024, signed by its President Luka Isaac, observed that, the hardship has become so severe that some unscrupulous people are taking advantage and exploiting them in different ways including human trafficking.\r\n\r\nThe refugees fled their homes in Borno State Nigeria, in 2013, to take refuge in Cameroon following the activities of Boko Haram terrorists.\r\n\r\nThe Governor of Niger State, Mohammed Bago has banned the mass purchase of food items at local markets, by traders from other states.\r\n\r\nThis is coming as President Bola Ahmed Tinubu directed the immediate release of over 100,000 metric tons of assorted food items from the strategic reserve and the Rice Millers Association of Nigeria and the importation of shortfalls after the release of the food commodities, in a bid to cushion the rising food shortage in the country.\r\n\r\nThe Governor says the ban comes after residents trooped to the streets of Minna, to protest the rising cost of living, Bago blamed the hike in the prices of commodities, particularly food items, on traders who stormed local markets to mop up grains and convey them to neighbouring states.\r\n\r\nIn the spirit of the super eagles victory, over the Bafana Bafana of South Africa, a heartwarming video which captured the moment female students at various hostels shared their excitement and sang the national anthem after nigeria√¢‚Ç¨‚Ñ¢s victory has made rounds on social media.\r\n\r\nIn South Africa, another video captured students welcoming their Nigerian teacher after the super eagles victory.\r\n\r\n#tinubu #edwardbuba #cameroon #mohammedbago #supereagles #southafrica #arise #arisetv #arisenews\r\n', 'Breaking News', 22, 0.0000, 25.0000, 10, '10', 50.0000, '2024-02-09 21:01:05'),
