(31, 'nuelodekunle20@gmail.com', '10 Things You Never Knew About VICTOR OSIMHEN', 'NGN', 5.0000, 'https://www.youtube.com/embed/obCUDPSA-dg?si=FGkBF-xyg1RCzWtU', 'Victor Osimhen is a professional footballer who currently plays for Napoli and the Nigerian national team as a striker. \r\n\r\nOsimhen who was born on December 29, 1998, grew up in the Lagos suburb of Olusosun, idolizing former Chelsea and Ivory Coast striker Didier Drogba.\r\n\r\nThe Napoli striker has a strong religious background and is a devout Christian. He was brought up as a Christian, and he has talked about the significance of his faith in his life. He frequently posts Bible scriptures on his social media platforms and repeatedly states that his faith gives him courage and drive.\r\n\r\nOsimhen first started playing football at the Ultimate Strikers Academy before traveling to Europe to play for several clubs.\r\n\r\nHis father, like many other Nigerian parents, wanted him to become a doctor, but he decided to pursue a career in soccer instead. And as luck would have it, he was among the tens of thousands of eager young people who had just 15 minutes to show what they could do at the 2014 Nigeria Under-17 team screening in Abuja, which was organized by Coach Emmanuel Amuneke.  ', 'Sports', 11, 0.0000, 25.0000, 8, '8', 40.0000, '2024-02-13 20:25:22'),
