(56, 'nuelodekunle20@gmail.com', 'Burkina Faso And These 2 Countries Just Formed a New Currency, Ditching The CFA. France In Trouble!', 'NGN', 5.0000, 'https://www.youtube.com/embed/3wojfabSfJk?si=tW8MOFtGS3xlrd72', 'In 1962, Mali became the first country in Francophone Africa to ditch the CFA franc and create its own currency, the Malian franc. Unfortunately due to internal divisions and France√¢‚Ç¨‚Ñ¢s fierce determination not to allow any of its former colonies to have complete independence, the Malian franc was abandoned, and Mali integrated into the CFA zone in 1984. Since then, no Francophone country has toyed with the idea of ditching the CFA franc and creating its own currency, until now. After announcing their withdrawal from the ECOWAS bloc, the military juntas of Niger and Burkina Faso have revealed that the next thing on their agenda is to create a single regional currency. According to President Traore, &#34;It&#39;s not just the currency. Anything that maintains us in slavery, we&#39;ll break those bonds,&#34; The head of the Niger√¢‚Ç¨‚Ñ¢s junta, Abdourahamane Tiani, also echoed the same views during an interview on state television, saying that abandoning the CFA Frank would be a sign of sovereignty and a necessary step and move from French colonization.', 'Politics', 8, 0.0000, 0.0000, 10, '10', 50.0000, '2024-02-28 21:16:15'),
